    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 / 7 * - col2 NOT IN ( - 75 + + - 11, col1 / - col2 + - + 10 + - + 26 );
  - name: tab2

outputs:
  - name: q11690.out
    data: |
      46	51	23
      64	77	40
      75	67	58
